import Hero from '../components/Hero';
import Banner from '../components/Banner';
import { Link } from 'react-router-dom';

export default function Error() {
    return (
        <Hero>
            <Banner>
                <Link to="/">go to home</Link>
            </Banner>
        </Hero>
    )
}
